import React from 'react';
import './Hero.css';


function Hero() {

  const Quantity ={
    '--quantity' : 11 ,
  };

  const SliderImage=(position)=>({
    '--position' : position,
  });

  return (
    <div className='main-box' id='hero'>
      <div className='banner'>
        <div className='slider' style={Quantity}>
        <img src='./images/CPlusPlus.svg' className='item' style={SliderImage(1)} alt='img'/>
        <img src='./images/Python.svg' className='item' style={SliderImage(2)} alt='img'/>
        <img src='./images/css.svg' className='item' style={SliderImage(4)} alt='img'/>
        <img src='./images/html.svg' className='item' style={SliderImage(5)} alt='img'/>
        <img src='./images/JS.svg' className='item' style={SliderImage(6)} alt='img'/>
        <img src='./images/Java.svg' className='item' style={SliderImage(8)} alt='img'/>
        <img src='./images/Prolog.png' className='item' style={SliderImage(3)} alt='img'/>
        <img src='./images/mongodb.svg' className='item' style={SliderImage(11)} alt='img'/>
        <img src='./images/mysql.svg' className='item' style={SliderImage(10)} alt='img'/>
        <img src='./images/react.svg' className='item' style={SliderImage(7)} alt='img'/>
        <img src='./images/spring.svg' className='item' style={SliderImage(9)} alt='img'/>
        </div>
      </div>

    </div>
  )
}

export default Hero
